(columnIndex) => {
		if (api_getRecentNearby.data === undefined) {
			return [{}, {}]
		}
		const data = api_getRecentNearby.data
		let items = [];
		[columnIndex, columnIndex + 5].forEach((i) => {
			try {
				items.push(data[i])
			} catch {
				items.push({})
			}
		})
		return items
	}

